import * as React from 'react';
import wrapIcon from '../utils/wrapIcon';
const rawSvg = (iconProps) => {
    const { className, primaryFill } = iconProps;
    return React.createElement("svg", { width: 24, height: 24, viewBox: "0 0 24 24", xmlns: "http://www.w3.org/2000/svg", className: className },
        React.createElement("path", { d: "M21 12.02V8.5H3v9.25C3 19.55 4.46 21 6.25 21h5.77A6.5 6.5 0 0121 12.02zm0-5.77C21 4.45 19.54 3 17.75 3H6.25A3.25 3.25 0 003 6.25V7h18v-.75zm2 11.25a5.5 5.5 0 10-11 0 5.5 5.5 0 0011 0zm-6-3a.5.5 0 011 0v4a.5.5 0 01-1 0v-4zm1.13 6a.62.62 0 11-1.25 0 .62.62 0 011.25 0z", fill: primaryFill }));
};
const CalendarError24Filled = wrapIcon(rawSvg({}), 'CalendarError24Filled');
export default CalendarError24Filled;
